import React from "react";
import { BsInstagram, BsPinterest, BsTiktok, BsTwitter, BsMailbox } from 'react-icons/bs';

const Footer : React.FC = () => {
    return(
        <>
            <p className="font-marker">sketchsauce</p>
            <div className="flex">
                <BsTiktok className="m-1"/>
                <BsInstagram className="m-1"/>
                <BsTwitter className="m-1"/>
                <BsPinterest className="m-1"/>
            </div>

            <div className="flex-col">
                <BsMailbox />
            </div>
        </>
    );
}

export default Footer;
